import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  const navigationHandler = () => {
    navigate("/About");
  };

  return (
    <>
      <h1 onClick={navigationHandler}>Home</h1>
    </>
  );
};
export default Home;
